INSERT INTO `v1_0b52d19c3bab9981abbabab91a91fc047923e89a7285a6a773a343749b6f6fdd` VALUES (76030004, "物理防御力（ダウン不可）アップ", "boss_def_lower_limit", "バトル開始時、すべてのモンスターの物理防御力を中アップさせる。この効果は物理防御力ダウンの影響を受けない。", 603000404);
